/* 
  1. react모듈에서 default옵션을 사요해서 component를 export했다면
  import 모듈명 from '모듈경로';

  2. react모듈에서 default옵션을 지정하지 않고 export했다면
  import{가져올 객체} from '모듈경로';
*/
import { Component } from "react"; 
// 현재 클래스를 Component로 만들기 위해 필요한 클래스

/* 
  Component의 생명주기(생성, 변경, 소멸)와 관련된 함수중 "생성"과정과 연관된 함수

  1. render() : return되는 html 형식의 코드를 화면에 그려주는 함수 (랜더링)
                화면에 내용이 변경되어야할 시점에 자동으로 호출됨.
  2. constructor(props)
 */

class Lifecycle extends Component{
  render(){
    console.log("3. render함수 호출");
    return(
      <h2>render 함수 호출</h2>
    )
  }

}
/* 
  작성한 컴포넌트를 내보내는 방법
  1. export default 객체명; 
  // default :  현재 모듈안에서 내보내기할 객체가 한개일때 사용
  2. export {클래스(함수),상수,배열,...};
*/
// export default Lifecycle;
export{Lifecycle};
